My (almost) first implementation ended up looking like this: let ap = self.a.dot(&self.p).into_shared(); let alpha = self.rs / self.p.dot(&ap); self.x += &(alpha * &self.p); self.r -= &(alpha * &ap); self.rsprev = self.rs; self.rs = self.r.dot(&self.r); self.p = (&self.r + &(&self.rs / self.rsprev * &self.p)).into_shared(); self.ap = Some(ap); which is quite similar to their Julia version (itself very similar to the wikipedia rendition), except for being more explicit about memory usage. Following IMDR, we define a struct CGIterable whose fields hold almost all intermediate state of the algorithm. A function takes a problem (in this case, \((A,b)\)) and returns a CGIterable, for which we implement the StreamingIterator trait. This trait is simple, and requires us to implement two methods: advance applies one iteration of the algorithm via the code above get borrows self and return Some(self). get returning the struct by reference is the main motivation to use StreamingIterator over the ubiquitous Iterator trait; it leaves decisions to copy state up to the implementor. The signatures for implementing an iterative method in this style are as follows: /// The state of a conjugate gradient algorithm.
#[derive(Clone)]
struct CGIterable { // contents
} impl CGIterable { /// Convert a LinearSystem problem into a StreamingIterator of conjugate gradient solutions. pub fn conjugate_gradient(problem: LinearSystem) -> CGIterable { // we chose to consume the LinearSystem, but it can probably be borrowed instead }
} impl StreamingIterator for CGIterable { type Item = CGIterable; /// Implementation of conjugate gradient iteration fn advance(&mut self) { // the improvement recipe goes here } fn get(&self) -> Option<&Self::Item> { // We will eventually change this, but for now: Some(self) }
}
